def encode(message):
    def swap_case(c):
        return c.lower() if c.isupper() else c.upper()

    def shift_vowel(c):
        vowels = 'aeiou'
        shift = 2
        if c.lower() in vowels:
            idx = vowels.index(c.lower())
            shifted_idx = (idx + shift) % len(vowels)  # Ensure it wraps around
            return vowels[shifted_idx].upper() if c.isupper() else vowels[shifted_idx]
        else:
            return c

    encoded_message = ''
    for c in message:
        if c.isalpha():
            shifted_c = shift_vowel(c)  # First, shift vowel if it's a vowel
            encoded_message += swap_case(shifted_c)  # Then, swap case
        else:
            encoded_message += c
    return encoded_message

