from heapq import heappush, heappop

def minPath(grid, k):
    if k == 1:
        return [min(min(row) for row in grid)]

    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    heap = []
    for i in range(N):
        for j in range(N):
            heappush(heap, (grid[i][j], i, j, [grid[i][j]]))

    visited = set()

    while heap:
        val, x, y, path = heappop(heap)
        if (x, y, len(path)) in visited:
            continue
        visited.add((x, y, len(path)))
        if len(path) == k:
            return path
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [grid[nx][ny]]
                heappush(heap, (newPath[-1], nx, ny, newPath))

