def is_multiply_prime(a):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    for i in range(2, a):
        if a % i == 0 and is_prime(i):
            for j in range(i+1, a): # start from i+1 to avoid repeating the same factor
                if a % (i*j) == 0 and is_prime(j):
                    k = a // (i*j)
                    if is_prime(k) and k != i and k != j:
                        return True
    return False

def is_simple_power(x, n):
    if n == 1:
        return x == 1
    power = 1
    while power < x:
        power *= n
    return power == x

def iscube(a):
