        return False
    # Check if 'b' is a substring of 'a' or any of its cyclic rotations.
    extended_a = a * 2  # Create a doubled version of 'a' to simulate all possible rotations
    return any(b in extended_a[i:i+len(b)] for i in range(len(a)))

def match_parens(lst):
    str1, str2 = lst
    # Attempt to concatenate in both possible orders and check if either results in a balanced string
    def is_balanced(s):
        balance = 0
        for char in s:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            if balance < 0:
                return False
        return balance == 0

    return 'Yes' if is_balanced(str1 + str2) or is_balanced(str2 + str1) else 'No'

