def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if start > end:
        return "NO"
    length_of_intersection = end - start
    if is_prime(length_of_intersection):
        return "YES"
    else:
        return "NO"

def split_words(txt):
    # Check for whitespace
    if ' ' in txt:
        return txt.split()
    # Check for commas
    elif ',' in txt:
        return txt.split(',')
    # If no whitespaces or commas, check for odd order lowercase letters
    else:
        odd_order_count = sum(1 for char in txt if char.islower() and (ord(char) - ord('a')) % 2 == 0)
        if odd_order_count == 0 and (txt.isalpha() == False):
            # If there are no lowercase letters with odd order or the text isn't purely alphabetical, return the text as is
            return [txt]
        else:
            # Return the count of odd order lowercase letters
            return odd_order_count

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                return False
            stack.pop()
    # The presence of a nested structure is determined not just by an empty stack,
    # but by the fact that there was at least one successful pairing of brackets.
    return len(string) > 0 and not stack

