    """Return the largest prime factor of n. Assume n > 1 and is not a prime."""
    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    prime_factor = 1
    i = 2

    while i <= n ** 0.5:
