    elif n == 2:
        return [3, 3, 2]

    trib = [3, 3, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(1 + i // 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 3])
    return trib

