def get_odd_collatz(n):
    odd_numbers = []
    while n != 1:
        if n % 2 == 1:
            odd_numbers.append(n)
        n = 3*n + 1 if n % 2 else n // 2
    odd_numbers.append(1)  # Including 1 as it is always part of the sequence and an odd number
    return sorted(set(odd_numbers))  # Removing duplicates and sorting the list

def can_arrange(arr):
