def tri(n):
    # Base cases to initialize the first three elements of the Tribonacci sequence
    if n == 0:
        return [3]
    elif n == 1:
        return [3, 1]
    elif n == 2:
        return [3, 1, 2]

    # Initialize the list with the first three elements of the Tribonacci sequence
    trib = [3, 1, 2]

    # Calculate the rest of the elements up to n
    for i in range(3, n + 1):
        # The next element is the sum of the previous three elements
        next_element = trib[i - 1] + trib[i - 2] + trib[i - 3]
        trib.append(next_element)

    return trib

def words_in_sentence(sentence):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    filtered_words = ' '.join(word for word in sentence.split() if is_prime(len(word)))
    return filtered_words
